text.inkscape:label:
{"align":"Right","attr":"set","prompt":"","src":"var rsssrc='http://rss.dw.com/rdf/rss-en-ger';
var width=1105;
var obj = thisobj;
var rsstitle,rssdescr,rssi;

var getRSS = function() {
rsstitle=[];
rssdescr=[];
rssi=0;
$.getJSON('rss.php?URL=' + encodeURIComponent(rsssrc), function(data){
 var i=0;
 for ( ; i<data.item.length ; i++)
 {
 rsstitle[i]=data.item[i].title||'';
 rssdescr[i]=data.item[i].description||'';
 }
 });
}

var showRSS = function() {
 if (rsstitle.length > 0)
 {
 obj.textContent = rsstitle[rssi%rsstitle.length] + ' - ' + rssdescr[rssi%rsstitle.length];
 window.RemoveAnimate( obj );
 var bb = obj.getBBox();
 if ( bb.width > width )
 {
 setTimeout( function() {
 window.Animate( obj, 
 'animateTransform',
 { 'attributeType': 'xml',
 'attributeName': 'transform',
 'type': 'translate',
 'from': '0 0 ',
 'to': '' + width - bb.width - width/3 + ' 0 ',
 'repeatCount': 'indefinite',
 'dur': 16, 
 'fill': 'freeze',
 'calcMode': 'paced'
 });
 }, 4000)
 } 
 }
 rssi++;
}

getRSS();
setInterval( getRSS, 300000 ); 
setInterval( showRSS, 20000 ); 
","tag":"#exec","type":"Variable"}

