text.inkscape:label:
{"align":"Right","attr":"set","prompt":"","src":"var loc="sao paulo";
setInterval( function() {
$.getJSON('http://api.openweathermap.org/data/2.5/weather?q='+loc+',br&units=metric&lang=pt&APPID=ba5a5a44279f9c8d124246f1147c2bed', function(data){
 if ( typeof(data.main)!="undefined" )
 window.SVGDoc.getElementById( "temp_" + loc.replace(/ /g , "_") ).textContent=parseFloat(data.main.temp).toFixed(1)+"°C";
 if ( typeof(data.weather)!="undefined" )
 {
 var objuse = window.SVGDoc.getElementById( "tempoagora_" + loc.replace(/ /g , "_") );
 if ( objuse )
 objuse.setAttributeNS( "http://www.w3.org/1999/xlink" , "href", "#" + data.weather[0].icon );
 }
 });
}, 30000 ); 
setInterval( function() {
$.getJSON('http://api.openweathermap.org/data/2.5/forecast/daily?q='+loc+',br&units=metric&lang=pt&APPID=ba5a5a44279f9c8d124246f1147c2bed', function(data){
 if ( typeof(data.list)!="undefined" )
 {
 window.SVGDoc.getElementById( "temphojemax_" + loc.replace(/ /g , "_") ).textContent = "Máx. " + parseFloat(data.list[0].temp.max).toFixed(1) + "°C";
 window.SVGDoc.getElementById( "temphojemin_" + loc.replace(/ /g , "_") ).textContent = "Mín. " + parseFloat(data.list[0].temp.min).toFixed(1) + "°C";
 window.SVGDoc.getElementById( "prevhoje_" + loc.replace(/ /g , "_") ).setAttributeNS( "http://www.w3.org/1999/xlink" , "href", "#" + data.list[0].weather[0].icon );
 window.SVGDoc.getElementById( "tempamanhamax_" + loc.replace(/ /g , "_") ).textContent = "Máx. " + parseFloat(data.list[1].temp.max).toFixed(1) + "°C";
 window.SVGDoc.getElementById( "tempamanhamin_" + loc.replace(/ /g , "_") ).textContent = "Mín. " + parseFloat(data.list[1].temp.min).toFixed(1) + "°C";
 window.SVGDoc.getElementById( "prevamanha_" + loc.replace(/ /g , "_") ).setAttributeNS( "http://www.w3.org/1999/xlink" , "href", "#" + data.list[1].weather[0].icon );
 }
 });
}, 32000 );
","tag":"#exec","type":"Data"}

